import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import salad from './salad.png';

export default class Header extends Component {
  render() {
    return (
        <div>
            <button><img className="salad-image" src={salad} alt="Logo" with="10" height="10" /><a href="#ensaladas">Ensaladas</a></button>
            <button><a href="#hamburgesas">Hamburgesas</a></button>
        </div>
    );
  }
}
